window.bookSummaryJSON = "<p>After half-killing Mother Blake's murderer, Breed is obliged to repay a debt to a powerful Prince of the Midnight Court.</p> <p>Armed with little more than a bad attitude, and partnered with a feckless sorcerer and an arrogant gang enforcer, Breed sets sail for the land of Voskva.</p> <p>They say no good deed goes unpunished.</p> <p>And damn them, they were right.</p> <p><i>No Good Deed</i> is the fifth book in the Chronicles of Breed.</p>"; 
